def if_decimal_is_divisible(binary_string):
    fib_nums = [0, 1]
    while len(fib_nums) < 110:
        fib_nums.append(fib_nums[-1] + fib_nums[-2])

    decimal_int = int(binary_string, 2)
    if decimal_int % fib_nums[109] == 0:
        return True
    else:
        return False
